import { RegisterComponent } from './components/register/register.component';
import { Page1Component } from './components/components/page1/page1.component';
import { Page2Component } from './components/components/page2/page2.component';
import { Page3Component } from './components/components/page3/page3.component';

@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    LoginComponent,
    RegisterComponent,
    Page1Component,
    Page2Component,
    Page3Component
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule, // HttpClientModule ekleyin
    ReactiveFormsModule // ReactiveFormsModule ekleyin
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
